import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';

const HowWeDoIt = () => {
  const [scrollY, setScrollY] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleBackToHome = (e) => {
    e.preventDefault();
    // Add a custom flag to indicate direction for the home page animation
    navigate('/', { state: { slideDirection: 'left' } });
  };

  return (
    <motion.div
      initial={{ x: '100%' }}
      animate={{ x: 0 }}
      exit={{ x: '-100%' }} // Exit to the left when going back
      transition={{ type: 'tween', duration: 0.5 }}
      className="relative min-h-[200vh]"
    >      <Navbar />
      
      {/* First Section - Dark Blue Background */}
      <section className="relative h-screen bg-[#00264D] flex flex-col justify-between pt-32">
        {/* Back to Home Link */}
        <h3 
          onClick={handleBackToHome}
          className="absolute top-32 left-20 text-white text-lg cursor-pointer hover:text-green-300 transition-colors duration-300 flex items-center gap-2 group"
        >
          <span className="transform group-hover:-translate-x-2 transition-transform duration-300">‚Üê</span>
          Back to Home
        </h3>

        {/* Scroll Indicator */}
        <div className="absolute left-1/2 bottom-12 -translate-x-1/2 flex flex-col items-center gap-2">
          <div className="w-[2px] h-16 bg-white/20 relative overflow-hidden">
            <motion.div 
              className="w-full h-full bg-white"
              animate={{
                y: ['-100%', '100%'],
              }}
              transition={{
                repeat: Infinity,
                duration: 1.5,
                ease: 'linear',
              }}
            />
          </div>
          <span className="text-white/60 text-sm">Scroll Down</span>
        </div>

        {/* Bottom Left Title */}        <div className="w-full px-20">
          <h1 className="text-white text-7xl font-bold mb-8">
            How We Do It
          </h1>
          <p className="text-white/80 text-xl max-w-2xl">
            We combine cutting-edge AI technology with deep industry expertise to transform the quality of interpersonal interactions.
          </p>
        </div>

        {/* Bottom Content */}
        <div className="w-full flex justify-between items-end p-20">
          {/* Stats or Key Points */}
          <div className="flex gap-20">
            <div>
              <h4 className="text-green-400 text-4xl font-bold mb-2">98%</h4>
              <p className="text-white/70">Accuracy Rate</p>
            </div>
            <div>
              <h4 className="text-green-400 text-4xl font-bold mb-2">24/7</h4>
              <p className="text-white/70">Support Available</p>
            </div>
            <div>
              <h4 className="text-green-400 text-4xl font-bold mb-2">500+</h4>
              <p className="text-white/70">Global Partners</p>
            </div>
          </div>
        </div>
      </section>

      {/* Second Section - White Background */}
      <section className="min-h-screen bg-white px-20 py-32">
        <div className="max-w-6xl mx-auto">
          <h2 className="text-black text-4xl font-bold mb-12">Our Process</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-12">
            {/* Process Steps */}
            <div className="p-8 bg-gray-50 rounded-xl">
              <div className="text-green-600 text-xl font-bold mb-4">01</div>
              <h3 className="text-xl font-bold mb-4">Data Collection</h3>
              <p className="text-gray-600">We gather and analyze relevant data from multiple sources to build a comprehensive understanding.</p>
            </div>
            <div className="p-8 bg-gray-50 rounded-xl">
              <div className="text-green-600 text-xl font-bold mb-4">02</div>
              <h3 className="text-xl font-bold mb-4">AI Processing</h3>
              <p className="text-gray-600">Our advanced AI algorithms process and interpret the data to generate actionable insights.</p>
            </div>
            <div className="p-8 bg-gray-50 rounded-xl">
              <div className="text-green-600 text-xl font-bold mb-4">03</div>
              <h3 className="text-xl font-bold mb-4">Implementation</h3>
              <p className="text-gray-600">We implement tailored solutions based on the insights to improve your business processes.</p>
            </div>
          </div>
        </div>
      </section>
    </motion.div>
  );
};

export default HowWeDoIt;
